import React from "react";
import DeleteIcon from '@material-ui/icons/Delete'

function Note({ index, title, content, onDelete }) {
  return (
    <div className="note">
      <h1>{title}</h1>
      <p>{content}</p>
      <button onClick={() => onDelete(index)}>
        <DeleteIcon />
      </button>
    </div>
  );
}

export default Note;
